import React from 'react';
import DashboardContent from "../components/DashboardContent";
import MainContent from "../components/MainContent";

const AnalyticsPage = () => {
    return (
        <div className="flex">
            <DashboardContent />
            <MainContent />
        </div>
    );
}

export default AnalyticsPage;
